import React from 'react';
import { BrowserRouter as Router, Route, Routes, Navigate } from 'react-router-dom';
import { useSelector } from 'react-redux';
import { ToastContainer } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';

// Import components
import Layout from './components/Layout';
import PrivateRoute from './components/PrivateRoute';

// Import pages
import Home from './pages/Home';
import Login from './pages/Login';
import Register from './pages/Register';
import Profile from './pages/Profile';
import NetworkAndUpgrade from './pages/NetworkAndUpgrade';
import GiftSystem from './pages/GiftSystem';
import SubscriptionMaintenance from './pages/SubscriptionMaintenance';
import Support from './pages/Support';

function App() {
  const isAuthenticated = useSelector(state => state.auth.isAuthenticated);

  return (
    <Router>
      <Layout>
        <Routes>
          <Route path="/" element={<Home />} />
          <Route 
            path="/login" 
            element={isAuthenticated ? <Navigate to="/profile" replace /> : <Login />} 
          />
          <Route 
            path="/register" 
            element={isAuthenticated ? <Navigate to="/profile" replace /> : <Register />} 
          />
          <Route 
            path="/profile" 
            element={<PrivateRoute><Profile /></PrivateRoute>} 
          />
          <Route 
            path="/network" 
            element={<PrivateRoute><NetworkAndUpgrade /></PrivateRoute>} 
          />
          <Route 
            path="/gift-system" 
            element={<PrivateRoute><GiftSystem /></PrivateRoute>} 
          />
          <Route 
            path="/subscription" 
            element={<PrivateRoute><SubscriptionMaintenance /></PrivateRoute>} 
          />
          <Route 
            path="/support" 
            element={<PrivateRoute><Support /></PrivateRoute>} 
          />
          <Route path="*" element={<Navigate to="/" replace />} />
        </Routes>
      </Layout>
      <ToastContainer />
    </Router>
  );
}

export default App;
